Dive WWII: Our Secret History

War Documentary hosted by Jules Hudson, published by BBC in 2013 - English narration


Information
------------------------------

A deep water dive team search the seabed off the coast of Northern Ireland for the forgotten shipwrecks of WWII's Battle of the Atlantic. Presented by Jules Hudson.
1.
The dive team discover the wreck of an Allied escort vessel sunk 40 miles off of Donegal as well as the wrecks of the German U-boats that prowled Northern Irish coastline searching for targets. And in Derry-Londonderry, Jules Hudson uncovers the remains of a massive US military base, as the residents of the city recount their memories of life on the front line.
2.
Jules explores how an airbase in Derry-Londonderry provided the vital air cover that the Allies needed to win the Battle of the Atlantic. At sea, the divers uncover the German U-boat wrecks that reveal how the battle finally swung in the Allies' favour, locate the remains of submarines sunk as part of the German surrender and dive to the wreck of Hitler's deadliest U-boat.

